import React from 'react';

class Outcome extends React.Component {
    render() {
        return (
            <>
            <div className="outcome">
                <div className="color"></div>
                <div className="desc">
                    <div className="top"></div>
                    <div className="bottom"></div>
                </div>
            </div>
            </>
        )
    }
}

export default Outcome;
